import React, { useState } from "react";
import logo from "../pages/Sanjivani.png";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBContainer,
} from "mdb-react-ui-kit";

export default function Navbar() {
  const [showBasic, setShowBasic] = useState(false);

  return (
    <MDBNavbar style={{ backgroundColor: "#2C3E50" }} expand="lg" dark>
      <MDBContainer fluid>
        <img
          src={logo}
          alt="logo"
          style={{ height: "50px", width: "65px", padding: "5px" }}
        />

        <MDBNavbarBrand
          style={{
            fontFamily: "Arial, sans-serif",
            fontSize: "24px",
            fontWeight: "bold",
            color: "#ffffff",
            paddingLeft: "10px",
          }}
          href="/landing"
        >
          Mechtrix Consultants
        </MDBNavbarBrand>

        <MDBNavbarToggler
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
          onClick={() => setShowBasic(!showBasic)}
        >
          <span className="navbar-toggler-icon" />
        </MDBNavbarToggler>

        <MDBCollapse navbar show={showBasic}>
          <MDBNavbarNav className="mr-auto mb-2 mb-lg-0">
            <MDBNavbarItem>
              <MDBNavbarLink
                active
                aria-current="page"
                href="/fab-lab"
                style={{
                  fontFamily: "Arial, sans-serif",
                  fontSize: "18px",
                  fontWeight: "bold",
                  color: "#ffffff",
                  textDecoration: "none",
                  padding: "20px 30px",
                  transition: "box-shadow 0.3s ease", // Transition for smooth effect
                }}
                className="glow-on-hover" // Added a class for the glow effect
              >
                Fab Lab
              </MDBNavbarLink>
            </MDBNavbarItem>
            {/* Add similar MDBNavbarItems for other links */}
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBContainer>
      <style>{`
        .glow-on-hover {
          transition: 0.3s;
          transform: translateY(-3px);
          box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2);
        }

        .glow-on-hover:hover {
          transform: translateY(-6px);
          box-shadow: 0 8px 16px 0 rgba(0, 0, 0, 0.2);
        }
      `}</style>
    </MDBNavbar>
  );
}
